import React from "react";
import { RootState } from "../../../types/interfaces";
import { useSelector } from "react-redux";
import {
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
  Paper,
  Typography,
  LinearProgress,
} from "@mui/material";

function LastOrders() {
  const orders = useSelector((state: RootState) => state.orders);

  React.useEffect(() => {
    console.log(orders);
  }, [orders]);

  return (
    <div>
      <Typography variant='h3'>Last Orders</Typography>

      <TableContainer component={Paper}>
        <Table>
          <TableHead>
            <TableRow>
              <TableCell align='left'>Status</TableCell>
              <TableCell align='center'>Spot/Name</TableCell>
              <TableCell align='center'>/Quantity</TableCell>
              <TableCell align='center'>Dates</TableCell>
              <TableCell align='center'>Order Id</TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {orders.map((order) => (
              <TableRow key={order.id}>
                <TableCell align='center'>{order.orderStatus}</TableCell>
                <TableCell align='center'>{order.spotCoordinates}</TableCell>
                <TableCell align='center'>
                  {order.productName}
                  <br />
                  {order.requiredQuantity}
                </TableCell>
                <TableCell align='center'>
                  {order.creationDate}
                  <br />
                  {order.closeDate}
                </TableCell>
                <TableCell align='center'>{order.id}</TableCell>
              </TableRow>
            ))}
          </TableBody>
        </Table>
      </TableContainer>
    </div>
  );
}

export default LastOrders;
